from random import randint
def change_row_to_column(answer):
	new_answer=[]
	for i in range(0, len(answer)):
		a = []
		for j in range(0, len(answer[i])):
			a.append(answer[j][i])
		new_answer.append(a)
	return new_answer

def change_row_to_box(answer):
	new_answer=[]
	for q in range(0, 9, 3):
		a = []
		b = []
		c = []
		for i in range(q, q + 3):
			for j in range(0, 3):
				a.append(answer[i][j])
			for j in range(3, 6):
				b.append(answer[i][j])
			for j in range(6, 9):
				c.append(answer[i][j])
		new_answer.append(a)
		new_answer.append(b)
		new_answer.append(c)
	return new_answer

def distance_metric(answer):
	distance=0
	for i in range(0,len(answer)):
		for j in range(0,len(answer[i])):
			if answer[i].count(answer[i][j])>1:
				distance+=answer[i].count(answer[i][j])-1
	return distance

def distance_metric_2(answer):
	distance=0
	for i in range(0,len(answer)):
		for j in range(1,10):
			if j not in answer[i]:
				distance+=1
	return distance

def tournoment(crom_list):
	tour_list=[]
	tournoment_in=4
	for i in range(0,tournoment_in):
		tour_list.append(crom_list[randint(0,len(crom_list)-1)])
	while(tournoment_in>1):
		first_elemination = []
		for i in range(0,int(tournoment_in),2):
			if tour_list[i][1]>tour_list[i+1][1]:
				first_elemination.append(tour_list[i+1])
			else:
				first_elemination.append(tour_list[i])
		tour_list=first_elemination.copy()
		tournoment_in/=2
	return tour_list[0]

def fitness(chromosomes,type):
	fitness_chromosome=[]
	if type==1:
		for i in range(0,len(chromosomes)):
			ans=chromosomes[i].copy()
			dis=distance_metric(ans)
			ans1=change_row_to_column(ans)
			dis+=distance_metric(ans1)
			ans2=change_row_to_box(ans)
			dis+=distance_metric(ans2)
			fitness_chromosome.append([chromosomes[i],dis])
	elif type==2:
		for i in range(0,len(chromosomes)):
			ans=chromosomes[i].copy()
			dis=distance_metric_2(ans)
			ans1=change_row_to_column(ans)
			dis+=distance_metric_2(ans1)
			ans2=change_row_to_box(ans)
			dis+=distance_metric_2(ans2)
			fitness_chromosome.append([chromosomes[i],dis])
	return fitness_chromosome

def k_point_offspring(parent_0,parent_1,k):
	points=[]
	while len(points)<k:
		a=randint(1,len(parent_0)-2)
		if a not in points:
			points.append(a)
	points.append(0)
	points.append(len(parent_0))
	points.sort()
	offspring_1=[]
	offspring_2=[]
	flag=True
	for i in range(0,len(points)-1):
		if flag:
			for j in range(points[i],points[i+1]):
				offspring_1.append(parent_0[j])
				offspring_2.append(parent_1[j])
			flag=False
		else:
			for j in range(points[i],points[i+1]):
				offspring_1.append(parent_1[j])
				offspring_2.append(parent_0[j])
			flag=True
	return offspring_1,offspring_2

def create_First_Gene(population):
	genes=[]
	while len(genes)<population:
		b=[]
		for j in range(0,9):
			a=[]
			for i in range(0,9):
				a.append(randint(1,9))
			b.append(a)
		if b not in genes:
			genes.append(b)
	return genes

def write_data(name,data):
	file=open(name+".txt","w")
	for i in range(0,len(data)):
		for j in range(0,len(data[i])):
			file.write(str(data[i][j]))
	file.close()

def read_data(name):
	a=[]
	file=open(name+".txt","r")
	text=file.read()
	text=list(text)
	k=0
	for i in range(0,9):
		b=[]
		for j in range(0,9):
			b.append(int(text[k]))
			k=k+1
		a.append(b)
	return a

def mutation_2(mutate_chrom,mutate_gene,mutate_count,chromosome_list):          #   0<a<population      0<b<9          0<c<9
	mutate=[]
	i=0
	inf_break=0
	while i<mutate_chrom:
		j=0
		a = randint(0, len(chromosome_list) - 1)
		while j<mutate_gene:
			k=0
			b = randint(0, 8)
			while k<mutate_count:
				c=randint(0,8)
				d = [a, b, c]
				if d not in mutate:
					mutate.append(d)
					e=[1,2,3,4,5,6,7,8,9]
					e.remove(chromosome_list[a][b][c])
					f=randint(0,7)
					chromosome_list[a][b][c]=e[f]
					k+=1
				else:
					inf_break+=1
				if inf_break>30:
					inf_break=0
					break
			j+=1
		i+=1
	return chromosome_list

def find_minimums(Chromosomes_f):
	fit=[]
	for i in range(0,len(Chromosomes_f)):
		fit.append(Chromosomes_f[i][1])
	min_1=fit.index(min(fit))
	fit[min_1]=10000000000
	min_2=fit.index(min(fit))
	return min_1,min_2

